import React from 'react';

function Card(props){
    
    return(
        <>
        <div className = "card-box">
        <img src = {props.imgscr} />
        <p> {props.title} </p>
        <h2> {props.sname} </h2>
        <p><a href = {props.link} traget = "_blank">Click Me </a></p>
        </div>
        </>
    );
}

export default Card;
